import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';

const currDate=new Date().toLocaleDateString();
const currTime=new Date().getHours();
A={Nepal,India,America,UK}
let greeting='';
const cssStyle={
    color:"blue"

}
if(currTime===19){
    greeting='good afternoon';}

ReactDOM.render(<>
<h1>hello world</h1>
<h2 contentEditable="true">current date is {currDate} and time is {currTime} hello,<span style={cssStyle}> {greeting}</span></h2>
{
    A.map((val,index)=>
    {
        return(
        <Card txt={val[index]}/>);
    })

}
</>,
document.getElementById('root'));
